const SVG = ({ stroke, fill, width, icon, left, top, hiddenMobile }) => (
  <Wrapper
    viewBox={icons[icon].viewBox}
    stroke={stroke}
    fill={fill}
    svgWidth={twWidth[`${width}`]}
    left={left}
    top={top}
    hiddenMobile={hiddenMobile}
  >
    {icons[icon].shape}
  </Wrapper>
)

export default SVG

SVG.propTypes = {
  stroke: PropTypes.string,
  fill: PropTypes.string,
  width: PropTypes.number,
  icon: PropTypes.oneOf([
    'triangle',
    'circle',
    'arrowUp',
    'upDown',
    'box',
    'hexa',
    'game',
    'volumeUp',
    'notification',
    'work',
    'ticket',
    'setting',
    'chat',
    'paper',
    'heart',
    'chart',
    'ticketStar',
    'search',
    'play',
    'star',
    'send',
    'wallet',
    'arrowUpSquare',
    'timeCircle',
    'bookmark',
    'camera',
  ]).isRequired,
  left: PropTypes.string,
  top: PropTypes.string,
  hiddenMobile: PropTypes.bool,
}

SVG.defaultProps = {
  stroke: 'transparent',
  width: 8,
  fill: 'none',
  left: '0%',
  top: '0%',
  hiddenMobile: false,
}
